description:
Professional with 6 years of experience in the technology area, with a proactive, resilient, and eager for new knowledge profile, with mastery of the following hard skills:

- Microservices architecture and development;
- Experienced in programming using Java 7 to Java 11 and Kotlin 1.6;
- Good knowledge of Spring Framework, such as SpringBoot, SpringMVC, SpringWeb and SpringData among others;
- REST API architecture and development;
- Event-driven and distributed applications using Apache Kafka;
- Distributed applications using SNS topics and SQS queues;
- High-availability and criticality applications using AWS;

A result-oriented professional, offering 5+ years of experience in Software Design & Development;
presently working with a product-based company Cloud Cover Pvt. Ltd., Pune as Software Developer
